function App() {
  return (
    <BrowserRouter>  // ❌ REMOVE THIS LINE
      <Routes>
        <Route path="/" element={<ProductList />} />
        <Route path="/add" element={<ProductForm />} />
      </Routes>
    </BrowserRouter>  // ❌ REMOVE THIS LINE
  );
}
export default App;
